import React from 'react'

function Login(props) {

    const connect = () => {
        props.setConnectInfo({ id: 'sophie.dupont@gmail.com', psw: 'test' })
        props.setLoading(true)
    }

    return (
        <div className='login'>
            <button onClick={connect}>Connection</button>
        </div>
    )
}

export default Login
